import React from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom'
import { Container } from 'react-bootstrap';
import Header from './components/Header';
import Footer from './components/Footer';
import HomeScreens from './screens/HomeScreens';
import ProductsScreens from './screens/ProductsScreens';
import ProductScreens from './screens/ProductScreens';
import SellersScreens from './screens/SellersScreens';
import SellerScreens from './screens/SellerScreens';
const App=() => {
  return (
    <Router>
     <Header />
     <main className='py-3'>
       <Container>
       <Route path='/' component={HomeScreens} exact />
       <Route path='/products' component={ProductsScreens}  />
       <Route path='/product/:id' component={ProductScreens}  />
       <Route path='/products' component={SellersScreens}  />
       <Route path='/product/:id' component={SellerScreens}  />
       </Container>
     </main>
     <Footer />
    </Router>
  );
}

export default App;
